import adobexdLogo from './xd-logo.png'
import bootstrapLogo from './bootstrap-logo.png';
import css3Logo from './css3-logo.png';
import firebaseLogo from './firebase-logo.png';
import gitLogo from './git-logo.png';
import html5Logo from './html5-logo.png';
import javascriptLogo from './javascript-logo.png';
import jestLogo from './jest-logo.png';
import linuxLogo from './linux-logo.png';
import mongodbLogo from './mongodb-logo.png';
import nodeLogo from './node-logo.png';
import photoshopLogo from './photoshop-logo.png';
import pythonLogo from './python-logo.png';
import reactLogo from './react-logo.png';
import reduxLogo from './redux-logo.png';
import sassLogo from './sass-logo.png';

const logoPics = {
    AdobeXD: adobexdLogo,
    bootstrap: bootstrapLogo,
    CSS3: css3Logo,
    firebase: firebaseLogo,
    git: gitLogo,
    HTML5: html5Logo,
    javascript: javascriptLogo,
    jest: jestLogo,
    linux: linuxLogo,
    mongodb: mongodbLogo,
    node: nodeLogo,
    photoshop: photoshopLogo,
    python: pythonLogo,
    react: reactLogo,
    redux: reduxLogo,
    sass: sassLogo,
};

export default logoPics;
